import React, { Component } from 'react';
// import { Carousel } from 'react-responsive-carousel';

class DemoCarousel extends Component {
    render() {
        return (
            <div>


<div id="demo" class="carousel slide" data-ride="carousel">
  <ul class="carousel-indicators">
    <li data-target="#demo" data-slide-to="0" class="active"></li>
    <li data-target="#demo" data-slide-to="1"></li>
    <li data-target="#demo" data-slide-to="2"></li>
  </ul>
  <div class="carousel-inner">
    <div class="carousel-item active">
      <img src="https://www.google.com/search?q=slide+bootstrap&client=ubuntu&hs=2By&channel=fs&source=lnms&tbm=isch&sa=X&ved=0ahUKEwjz-PzElcvjAhUKrxoKHbEfBhYQ_AUIESgB&biw=1600&bih=771#" alt="Los Angeles" width="1100" height="500"/>
    </div>
    <div class="carousel-item">
      <img src="https://www.google.com/search?q=slide+bootstrap&client=ubuntu&hs=2By&channel=fs&source=lnms&tbm=isch&sa=X&ved=0ahUKEwjz-PzElcvjAhUKrxoKHbEfBhYQ_AUIESgB&biw=1600&bih=771#" alt="Chicago" width="1100" height="500"/>
    </div>
    <div class="carousel-item">
      <img src="https://www.google.com/search?q=slide+bootstrap&client=ubuntu&hs=2By&channel=fs&source=lnms&tbm=isch&sa=X&ved=0ahUKEwjz-PzElcvjAhUKrxoKHbEfBhYQ_AUIESgB&biw=1600&bih=771#" alt="New York" width="1100" height="500"/>
    </div>
  </div>
  <a class="carousel-control-prev" href="#demo" data-slide="prev">
    <span class="carousel-control-prev-icon"></span>
  </a>
  <a class="carousel-control-next" href="#demo" data-slide="next">
    <span class="carousel-control-next-icon"></span>
  </a>
</div>
            </div>
        );
    }
};

export default DemoCarousel
